import'./Home.css';






const Home = () => {
  return (
    <div className="home">
      <header>
        <h1>@VIBE STORE</h1>
        <h2>Shop with us anywhere, anytime</h2>
      </header>
      
      <main>
        <p className="radio">#Vibe Store: "Your one-stop destination for everything you desire."</p>
      </main>

      <footer>
        <p>&copy; 2024 Vibe Store. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
